import { Routes, Route } from 'react-router-dom';
import AllAccesses  from './Components/AllAccesses';
import SuccessAccesses from './Components/SuccessAccesses';
import Header from './Components/Header';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header/>
      <Routes>
        <Route path='/' element={<AllAccesses/>}/>
        <Route path='/success' element={<SuccessAccesses/>}/>
      </Routes>
    </div>
  );
}

export default App;
